import './App.css';

var Card = ()=>{
  var cardStyle={
    height:200,
    with:150,
    padding:0,
    backgroundColor: "#FFF",
    filter:"drop-shadow(0px 0px 5px #666)"
  }
  return(
    <div style={cardStyle}>
    <Square/>
    <Label/>

    </div>
  )
}

var Label = ()=>{
  var labelStyle={
    fontFamily:"sans-serif",
    fontWeight:"bold",
    padding:13,
    margin:0
  }

  return(
    <div style={labelStyle}>{this.props.color}</div>
  )
}

var Square =() =>{

  var squareStyle={
    height:150,
    backgroundColor: "#FF6663"//this.props.color
  }
  return(
    <div style={squareStyle}>{squareStyle.backgroundColor}</div>
  )
}


function App() {
  return (
    <div id="container">
    <Card/>

    </div>
  );
}

export default App;
